import React from 'react';
import { Container } from 'react-bootstrap';

const Home = () => {
  return (
    <Container>
      <h1>Welcome to my Portfolio</h1>
      <p>This is my portfolio showcasing my work...</p>
    </Container>
  );
};

export default Home;
